import React from "react";

const FavoritCards = ({ likedCards }) => {
  return (
    <div className="bodyAbout">
      <h1>Favorite Cards</h1>
      {likedCards && likedCards.length > 0 ? (
        <ul>
          {likedCards.map((card) => (
            <li key={card._id}>
                <img src={card.image.url} alt={card.image.alt} />
            
              <h2>{card.title}</h2>
              <p>{card.subtitle}</p>
              {card.address && card.address.country && <p>{card.address.country}</p>}
            </li>
          ))}
        </ul>
      ) : (
        <p>No favorite cards selected yet.</p>
      )}
    </div>
  );
};

export default FavoritCards;
